('visits.encounterTypeToVisitTypeMapping',NULL,'Specifies how encounter types are mapped to visit types when automatically assigning encounters to visits. e.g 1:1, 2:1, 3:2 in the format encounterTypeId:visitTypeId or encounterTypeUuid:visitTypeUuid or a combination of encounter/visit type uuids and ids e.g 1:759799ab-c9a5-435e-b671-77773ada74e4','c84f289c-3869-4683-9b14-ebc47c374212',NULL,NULL,NULL,NULL,NULL,NULL),
('webservices.rest.allowedips',NULL,'A comma-separate list of IP addresses that are allowed to access the web services. An empty string allows everyone to access all ws. \n        IPs can be declared with bit masks e.g. 10.0.0.0/30 matches 10.0.0.0 - 10.0.0.3 and 10.0.0.0/24 matches 10.0.0.0 - 10.0.0.255.','22fc209b-1a84-41f2-a29d-699ef14cd6fc',NULL,NULL,NULL,NULL,NULL,NULL),
('webservices.rest.enableStackTraceDetails','true','If the value of this setting is \"true\", then the details of the stackTrace would be shown in the error response. However, the recommendation is to keep it as \"false\", from the Security perspective, to avoid leaking implementation details.','748cee42-3084-4098-9a18-b42d93804bdf',NULL,NULL,NULL,NULL,NULL,NULL),
('webservices.rest.mandatory','false','true/false whether or not the webservices.rest module MUST start when openmrs starts.  This is used to make sure that mission critical modules are always running if openmrs is running.','3c8bc0fa-95c6-431f-ba9b-8c1f97a6e751',NULL,NULL,NULL,NULL,NULL,NULL),
('webservices.rest.maxResultsAbsolute','100','The absolute max results limit. If the client requests a larger number of results, then will get an error','aea4d8b1-627e-48c9-9339-b57b8dc77cbc',NULL,NULL,NULL,NULL,NULL,NULL),
('webservices.rest.maxResultsDefault','1000','Testing to billable service request limit','7987bd0e-0f00-492a-ad57-4f543f1f04c3',NULL,NULL,NULL,NULL,NULL,NULL),
('webservices.rest.quietDocs','true','If the value of this setting is \"true\", then nothing is logged while the Swagger specification is being generated.','2a7e99b4-ab91-4d9e-a97b-a7383560cc89',NULL,NULL,NULL,NULL,NULL,NULL),
('webservices.rest.started','true','DO NOT MODIFY. true/false whether or not the webservices.rest module has been started.  This is used to make sure modules that were running  prior to a restart are started again','40dc8551-3cd6-4070-9cbb-2016d0f1abe8',NULL,NULL,NULL,NULL,NULL,NULL),
('webservices.rest.uriPrefix',NULL,'The URI prefix through which clients consuming web services will connect to the web application, should be of the form http://{ipAddress}:{port}/{contextPath}','e15319f5-cf40-431e-9ab4-3c5db2c03598',NULL,NULL,NULL,NULL,NULL,NULL);
