INSERT INTO `notification_template` VALUES
(1,'STOCK_MGMT_QTY_BELOW_THRESHOLD','<html>\n        <body style=\"font-size:13px;color:#333333;font-family:arial,sans-serif;\">\n        Dear <b>%RECPT_NAME%</b>,\n        <br/>\n        <br/>\n        This is to notify you that the following stock items have their quantities at or below the set threshold.\n        <br/>\n        <br/>\n        <table style=\'text-align:left;white-space:nowrap;border:solid 1px grey;font-size:13px;\' border=\'0\' cellpadding=\'2\' cellspacing=\'0\'>\n        <tr>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;border-right:solid 1px grey;\'>Location</td>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;\'>&nbsp;&nbsp;&nbsp;</td>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;border-right:solid 1px grey;\'>Stock Item</td>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;\'>&nbsp;&nbsp;&nbsp;</td>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;border-right:solid 1px grey;\'>Quantity Threshold</td>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;\'>&nbsp;&nbsp;&nbsp;</td>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;\'>Current Quantity</td>\n        </tr>\n        %STOCK_ITEMS%\n        </table>\n        %MORE_INFO%\n        <br>\n        This email was sent from the automated system that cannot accept incoming email. Do not reply to this message.\n        <br>\n        <br>\n        <b>%CENTER_NAME%</b>\n        </body>\n        </html>','Stock item quantity reached threshold',NULL,NULL,0,'7a23df8e-53c7-11ed-b2e9-00155dc74b5a'),
(2,'STOCK_MGMT_BATCH_EXPIRING','<html>\n        <body style=\'font-size:13px;color:#333333;font-family:arial,sans-serif;\'>\n        %RECPT_NAME%,\n        <br/>\n        <br/>\n        This is to notify you that the following stock items with batch information below are expiring soon.\n        <br/>\n        <br/>\n        <table style=\'text-align:left;white-space:nowrap;border:solid 1px grey;font-size:13px;\' cellpadding=\'2\' cellspacing=\'0\' border=\'0\'>\n        <tr>\n        <td colspan=\"3\" style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;border-right:solid 1px grey;\'>Stock Item</td>\n\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;\'>&nbsp;&nbsp;&nbsp;</td>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;border-right:solid 1px grey;text-align:right;\'>Batch</td>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;\'>&nbsp;&nbsp;&nbsp;</td>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;border-right:solid 1px grey;text-align:right;\'>Quantity</td>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;\'>&nbsp;&nbsp;&nbsp;</td>\n        <td style=\'padding: 0.5rem;font-weight:bold;border-bottom:solid 1px grey;text-align:right;\'>Expiry Date</td>\n        </tr>\n        %STOCK_ITEMS%\n        </table>\n        %MORE_INFO%\n        <br>\n        This email was sent from the automated system that cannot accept incoming email. Do not reply to this message.\n        <br>\n        <br>\n        <b>%CENTER_NAME%</b>\n        </body>\n        </html>','Stock item batch expiring',NULL,NULL,0,'ff9f1cb5-576a-11ed-a495-00155dc81c72'),
(3,'STOCK_MGMT_OPERATION_ACTION','<html>\n        <body style=\'font-size:13px;color:#333333;font-family:arial,sans-serif;\'>\n        Hello,\n        <br/>\n        <br/>\n        This is to notify you that <b>%ACTION_BY%</b> has %OPERATION_ACTION% the stock operation <b>%OPERATION_TYPE% %OPERATION_REF%</b>.\n        <br/>\n        <br/>\n        <table style=\'text-align:left;white-space:nowrap;border:0;font-size:13px;\' cellpadding=\'2\' cellspacing=\'0\' border=\'0\'>\n        %OPERATION_BASIC_INFO%\n        </table>\n        <br/>\n        Access the medical records system to view more details about the transaction.\n        <br/>\n        <br/>\n        This email was sent from the automated system that cannot accept incoming email. Do not reply to this message.\n        <br>\n        <br>\n        <b>%CENTER_NAME%</b>\n        </body>\n        </html>','%LOCATION%: Stock Operation %OPERATION_TYPE% %OPERATION_REF% %OPERATION_ACTION%',NULL,NULL,0,'59edf349-5b76-11ed-8829-00155d8315fc');
