INSERT INTO `serialized_object` VALUES
(1,'Concepts Report','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"094a9c78-9fb1-4eb2-bfc4-bc9fe8b5b4b4\" retired=\"false\">\n  <name>Concepts Report</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2024-10-23 14:06:38 UTC</dateCreated>\n  <parameters id=\"4\"/>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"5\">\n    <entry>\n      <string>Concepts Report</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"6\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"7\" retired=\"false\">\n          <name>Concepts SQL Dataset</name>\n          <description></description>\n          <parameters id=\"8\"/>\n          <sqlQuery>SELECT `concept`.`concept_id` AS `concept_id`,\n       `concept_reference_source`.`name` AS `Concept Mapping Source`,\n       `concept_reference_term`.`code` AS `Concept Mapping Code`,\n       `concept_reference_term`.`name` AS `Concept Mapping Name`,\n       `concept_name`.`name` AS `name`,\n       `concept_name`.`locale` AS `locale`,\n       `concept_name`.`locale_preferred` AS `locale_preferred`,\n       `concept`.`retired` AS `retired`,\n       `concept`.`uuid` AS `uuid`\nFROM `concept`\nLEFT JOIN `concept_reference_map` `concept_reference_map` ON `concept`.`concept_id` = `concept_reference_map`.`concept_id`\nLEFT JOIN `concept_reference_term` `concept_reference_term` ON `concept_reference_map`.`concept_reference_term_id` = `concept_reference_term`.`concept_reference_term_id`\nLEFT JOIN `concept_reference_source` `concept_reference_source` ON `concept_reference_term`.`concept_source_id` = `concept_reference_source`.`concept_source_id`\nLEFT JOIN `concept_name` `concept_name` ON `concept`.`concept_id` = `concept_name`.`concept_id`</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"9\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2024-10-23 14:06:38',2,NULL,NULL,0,NULL,NULL,NULL,'094a9c78-9fb1-4eb2-bfc4-bc9fe8b5b4b4'),
(2,'Encounters Report','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"320d3c2a-93d2-4bba-887b-f9cb04778dde\" retired=\"false\">\n  <name>Encounters Report</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2024-10-23 14:06:38 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <defaultValue class=\"date\" id=\"6\">1970-01-01 00:00:00 UTC</defaultValue>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <defaultValue class=\"date\" id=\"8\">2024-10-23 00:00:00 UTC</defaultValue>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>Encounters Report</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" retired=\"false\">\n          <name>Encounters SQL Dataset</name>\n          <description></description>\n          <parameters reference=\"4\"/>\n          <sqlQuery>select\n    encounter.encounter_id AS encounter_id,\n    encounter.patient_id AS encounter_patient_id,\n    encounter.encounter_type AS encounter_type_id,\n    encounter_type.name AS encounter_type_name,\n    encounter_type.uuid AS encounter_type_uuid,\n    encounter_type.retired AS encounter_type_retired,\n    encounter.encounter_datetime AS encounter_datetime,\n    encounter.voided AS encounter_voided,\n    encounter.visit_id AS encounter_visit_id,\n    visit_type.name AS visit_type_name,\n    visit_type.uuid AS visit_type_uuid,\n    visit_type.description AS visit_type_description,\n    visit.date_started AS visit_date_started,\n    visit.date_stopped AS visit_date_stopped,\n    visit.voided AS visit_voided,\n    visit_type.retired AS visit_type_retired,\n    encounter.form_id AS encounter_form_id,\n    form.name AS form_name,\n    form.uuid AS form_uuid,\n    form.version AS form_version,\n    form.published AS form_published,\n    form.encounter_type AS form_encounter_type,\n    form.retired AS form_retired,\n    encounter.location_id AS encounter_location_id,\n    location.name AS location_name,\n    location.uuid AS location_uuid,\n    location.address1 AS location_address1,\n    location.retired AS location_retired,\n    encounter.creator AS encounter_creator,\n    encounter.date_created AS encounter_date_created,\n    encounter.voided_by AS encounter_voided_by,\n    encounter.date_voided AS encounter_date_voided,\n    encounter.void_reason AS encounter_void_reason,\n    encounter.changed_by AS encounter_changed_by,\n    encounter.date_changed AS encounter_date_changed,\n    encounter.uuid AS encounter_uuid,\n    encounter_type.description AS encounter_type_description,\n    form.description AS form_description,\n    form.template AS form_template,\n    form.build AS form_build,\n\n    location.description AS location_description,\n    location.address2 AS location_address2,\n    location.city_village AS location_city_village,\n    location.state_province AS location_state_province,\n    location.postal_code AS location_postal_code,\n    location.country AS location_country,\n    location.parent_location AS location_parent_location,\n    location.county_district AS location_county_district\nfrom\n    encounter\n    LEFT JOIN encounter_type encounter_type ON encounter.encounter_type = encounter_type.encounter_type_id\n    LEFT JOIN location location ON encounter.location_id = location.location_id\n    LEFT JOIN form form ON encounter.form_id = form.form_id\n    LEFT JOIN visit visit ON encounter.visit_id = visit.visit_id\n    LEFT JOIN visit_type visit_type ON visit.visit_type_id = visit_type.visit_type_id\nWHERE\n    encounter_datetime &gt;= :startDate\n    OR encounter_datetime &lt;= :endDate</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2024-10-23 14:06:38',2,NULL,NULL,0,NULL,NULL,NULL,'320d3c2a-93d2-4bba-887b-f9cb04778dde'),
(3,'Diagnoses Report','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"e0cf75f3-d0e8-42e8-9c4d-6d66a52d56ca\" retired=\"false\">\n  <name>Diagnoses Report</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2024-10-23 14:06:38 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <defaultValue class=\"date\" id=\"6\">1970-01-01 00:00:00 UTC</defaultValue>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <defaultValue class=\"date\" id=\"8\">2024-10-23 00:00:00 UTC</defaultValue>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>Diagnoses Report</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" retired=\"false\">\n          <name>Diagnoses SQL Dataset</name>\n          <description></description>\n          <parameters reference=\"4\"/>\n          <sqlQuery>select\n    diagnosis_id,\n    encounter_id,\n    patient_id,\n    diagnosis_coded,\n    diagnosis_non_coded,\n    diagnosis_coded_name,\n    dx_rank,\n    certainty,\n    creator,\n    date_created,\n    voided,\n    v