(5,'Observations Report','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"3fc926dd-f317-426c-b96d-0e8d504eee5e\" retired=\"false\">\n  <name>Observations Report</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2024-10-23 14:06:38 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <defaultValue class=\"date\" id=\"6\">1970-01-01 00:00:00 UTC</defaultValue>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <defaultValue class=\"date\" id=\"8\">2024-10-23 00:00:00 UTC</defaultValue>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>Observations Report</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" retired=\"false\">\n          <name>Observations SQL Dataset</name>\n          <description></description>\n          <parameters reference=\"4\"/>\n          <sqlQuery>SELECT\n    obs.obs_id AS obs_id,\n    obs.person_id AS person_id,\n    obs.concept_id AS concept_id,\n    concept_concept_name.name AS concept_name,\n    concept_concept_name.uuid AS concept_uuid,\n    obs.obs_group_id AS obs_group_id,\n    obs.accession_number AS accession_number,\n    obs.form_namespace_and_path AS form_namespace_and_path,\n    obs.value_coded AS value_coded,\n    value_concept_name.name AS value_coded_name,\n    value_concept_name.uuid AS value_coded_uuid,\n    obs.value_coded_name_id AS value_coded_name_id,\n    obs.value_drug AS value_drug,\n    obs.value_datetime AS value_datetime,\n    obs.value_numeric AS value_numeric,\n    obs.value_modifier AS value_modifier,\n    obs.value_text AS value_text,\n    obs.value_complex AS value_complex,\n    obs.comments AS comments,\n    obs.creator AS creator,\n    obs.date_created AS date_created,\n    obs.voided AS obs_voided,\n    obs.void_reason AS obs_void_reason,\n    obs.previous_version AS previous_version,\n    encounter.encounter_id AS encounter_id,\n    encounter.voided AS encounter_voided,\n    encounter_type.name AS encounter_type_name,\n    encounter_type.description AS encounter_type_description,\n    encounter_type.uuid AS encounter_type_uuid,\n    encounter_type.retired AS encounter_type_retired,\n    visit.visit_id AS visit_id,\n    visit.date_started AS visit_date_started,\n    visit.date_stopped AS visit_date_stopped,\n    visit_type.name AS visit_type_name,\n    visit_type.uuid AS visit_type_uuid,\n    visit_type.retired AS visit_type_retired,\n    visit.location_id AS location_id,\n    location.name AS location_name,\n    location.address1 AS location_address1,\n    location.address2 AS location_address2,\n    location.city_village AS location_city_village,\n    location.state_province AS location_state_province,\n    location.postal_code AS location_postal_code,\n    location.country AS location_country,\n    location.retired AS location_retired,\n    location.uuid AS location_uuid\nFROM\n    obs\n    LEFT JOIN concept_name value_concept_name ON obs.value_coded = value_concept_name.concept_id\n    AND obs.value_coded IS NOT NULL\n    AND value_concept_name.locale_preferred = true\n    AND value_concept_name.locale = &apos;en&apos;\n    LEFT JOIN encounter encounter ON obs.encounter_id = encounter.encounter_id\n    LEFT JOIN visit visit ON encounter.visit_id = visit.visit_id\n    LEFT JOIN encounter_type encounter_type ON encounter.encounter_type = encounter_type.encounter_type_id\n    LEFT JOIN visit_type visit_type ON visit.visit_type_id = visit_type.visit_type_id\n    LEFT JOIN location location ON obs.location_id = location.location_id\n    LEFT JOIN concept_name concept_concept_name ON obs.concept_id = concept_concept_name.concept_id\n    AND concept_concept_name.locale_preferred = true\n    AND concept_concept_name.locale = &apos;en&apos;\nWHERE\n    (:startDate IS NULL OR obs_datetime &gt;= :startDate)\n    AND\n    (:endDate IS NULL OR obs_datetime &lt;= :endDate)\n</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2024-10-23 14:06:38',2,NULL,NULL,0,NULL,NULL,NULL,'3fc926dd-f317-426c-b96d-0e8d504eee5e'),
(6,'Patients Report','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"a7461fe7-f943-4d4d-b2d5-66ffefd9ca3c\" retired=\"false\">\n  <name>Patients Report</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2024-10-23 14:06:38 UTC</dateCreated>\n  <parameters id=\"4\"/>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"5\">\n    <entry>\n      <string>Patients Report</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"6\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"7\" retired=\"false\">\n          <name>Patients SQL Dataset</name>\n          <description></description>\n          <parameters id=\"8\"/>\n          <sqlQuery>SELECT\n    patient.patient_id AS patient_id,\n    name.given_name AS given_name,\n    name.middle_name AS middle_name,\n    name.family_name AS family_name,\n    identifier.identifier AS identifier,\n    person.gender AS gender,\n    person.birthdate AS birthdate,\n    person.birthdate_estimated AS birthdate_estimated,\n    address.city_village AS city,\n    address.address1 AS address1,\n    address.address2 AS address2,\n    address.state_province AS state_province,\n    address.country AS country,\n    person.dead AS dead,\n    person.death_date AS death_date,\n    person.cause_of_death AS cause_of_death,\n    person.creator AS creator,\n    person.date_created AS date_created,\n    person.voided AS person_voided,\n    person.void_reason AS person_void_reason\nFROM\n    patient\n    LEFT JOIN person person ON patient.patient_id = person.person_id\n    LEFT JOIN person_name name ON person.person_id = name.person_id\n    LEFT JOIN person_address address ON person.person_id = address.person_id\n    LEFT JOIN patient_identifier identifier ON patient.patient_id = identifier.patient_id\n    GROUP BY patient_id\n</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"9\"/>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2024-10-23 14:06:38',2,NULL,NULL,0,NULL,NULL,NULL,'a7461fe7-f943-4d4d-b2d5-66ffefd9ca3c'),
(7,'Programs Report','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"2ab6f727-1c17-4c3b-b7b6-6447825dc5fb\" retired=\"false\">\n  <name>Programs Report</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2024-10-23 14:06:38 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>dateEnrolled</name>\n      <label>Date Enrolled</label>\n      <type>java.util.Date</type>\n      <defaultValue class=\"date\" id=\"6\">1970-01-01 00:00:00 UTC</defaultValue>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"7\">\n    <entry>\n      <string>Programs Report</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"8\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"9\" retired=\"false\">\n          <name>Programs SQL Dataset</name>\n          <description></description>\n          <parameters reference=\"4\"/>\n          <sqlQuery>SELECT\n    patient_program.patient_program_id AS patient_program_id,\n    patient_program.patient_id AS patient_id,\n    patient_program.program_id AS program_id,\n    patient_program.date_enrolled AS date_enrolled,\n    patient_program.date_completed AS date_completed,\n    patient_program.location_id AS location_id,\n    patient_program.outcome_concept_id AS outcome_concept_id,\n    patient_program.creator AS creator,\n    patient_program.date_created AS date_created,\n    patient_program.changed_by AS changed_by,\n    patient_program.date_changed AS date_changed,\n    patient_program.voided AS voided,\n    patient_program.voided_by AS voided_by,\n    patient_program.date_voided AS date_voided,\n    patient_program.void_reason AS void_reason,\n    patient_program.uuid as uuid,\n    program.retired AS program_retired,\n    program.name AS program_name,\n    program.description AS program_description,\n    program.uuid AS program_uuid,\n    program.concept_id AS program_concept_id,\n    concept_concept_name.name AS concept_name,\n    concept_concept_name.uuid AS concept_uuid,\n    program.outcomes_concept_id AS program_outcomes_concept_id,\n    outcomes_concept.name AS outcomes_concept_name,\n    outcomes_concept.uuid AS outcomes_concept_uuid\nFROM\n    patient_program\n    LEFT JOIN program program ON patient_program.program_id = program.program_id\n    LEFT JOIN concept_name outcomes_concept ON program.outcomes_concept_id = outcomes_concept.concept_id\n    AND program.outcomes_concept_id IS NOT NULL\n    AND outcomes_concept.locale_preferred = true\n    AND outcomes_concept.locale = &apos;en&apos;\n    LEFT JOIN concept_name concept_concept_name ON program.concept_id = concept_concept_name.concept_id\n    AND concept_concept_name.locale_preferred = true\n    AND concept_concept_name.locale = &apos;en&apos;\n    WHERE \n        date_enrolled &gt;= :dateEnrolled\n</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"10\">\n          <entry>\n            <string>dateEnrolled</string>\n            <string>${dateEnrolled}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2024-10-23 14:06:38',2,NULL,NULL,0,NULL,NULL,NULL,'2ab6f727-1c17-4c3b-b7b6-6447825dc5fb'),
(8,'Visits Report','','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.report.definition.ReportDefinition','org.openmrs.module.reporting.serializer.ReportingSerializer','<org.openmrs.module.reporting.report.definition.ReportDefinition id=\"1\" uuid=\"ee0d4e55-9a0e-4d7c-ba85-e534102141ee\" retired=\"false\">\n  <name>Visits Report</name>\n  <description></description>\n  <creator id=\"2\" uuid=\"A4F30A1B-5EB9-11DF-A648-37A07F9C90FB\"/>\n  <dateCreated id=\"3\">2024-10-23 14:06:38 UTC</dateCreated>\n  <parameters id=\"4\">\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"5\">\n      <name>startDate</name>\n      <label>Start Date</label>\n      <type>java.util.Date</type>\n      <defaultValue class=\"date\" id=\"6\">1970-01-01 00:00:00 UTC</defaultValue>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n    <org.openmrs.module.reporting.evaluation.parameter.Parameter id=\"7\">\n      <name>endDate</name>\n      <label>End Date</label>\n      <type>java.util.Date</type>\n      <defaultValue class=\"date\" id=\"8\">2024-10-23 00:00:00 UTC</defaultValue>\n      <required>true</required>\n    </org.openmrs.module.reporting.evaluation.parameter.Parameter>\n  </parameters>\n  <dataSetDefinitions class=\"linked-hash-map\" id=\"9\">\n    <entry>\n      <string>Visits Report</string>\n      <org.openmrs.module.reporting.evaluation.parameter.Mapped id=\"10\">\n        <parameterizable class=\"org.openmrs.module.reporting.dataset.definition.SqlDataSetDefinition\" id=\"11\" retired=\"false\">\n          <name>commonreports.report.visit.table.datasetName</name>\n          <description>commonreports.report.visit.table.datasetDescription</description>\n          <parameters reference=\"4\"/>\n          <sqlQuery>SELECT\n    visit.visit_id AS visit_id,\n    visit.patient_id AS patient_id,\n    visit_type.uuid AS visit_type_uuid,\n    visit_type.name AS visit_type,\n    visit.date_started AS date_started,\n    visit.date_stopped AS date_stopped,\n    visit.indication_concept_id AS indication_concept_id,\n    visit.location_id AS location_id,\n    visit.voided AS visit_voided,\n    visit.uuid AS visit_uuid,\n    person.person_id AS person_id,\n    person.gender AS gender,\n    person.birthdate AS birthdate,\n    person.birthdate_estimated AS birthdate_estimated,\n    CASE\n        WHEN timestampdiff(year, person.birthdate, visit.date_started) &lt; 1 then &apos;0 - 1&apos;\n        WHEN timestampdiff(year, person.birthdate, visit.date_started) &lt;= 4 then &apos;1 - 4&apos;\n        WHEN timestampdiff(year, person.birthdate, visit.date_started) &lt;= 9 then &apos;5 - 9&apos;\n        WHEN timestampdiff(year, person.birthdate, visit.date_started) &lt;= 14 then &apos;10 - 14&apos;\n        WHEN timestampdiff(year, person.birthdate, visit.date_started) &lt;= 19 then &apos;15 - 19&apos;\n        WHEN timestampdiff(year, person.birthdate, visit.date_started) &lt;= 24 then &apos;20 - 24&apos;\n        WHEN timestampdiff(year, person.birthdate, visit.date_started) &gt; 24 then &apos;25+&apos;\n        ELSE &apos;Invalid birthdate&apos;\n    END AS `age_at_visit_group_profile_1`,\n    timestampdiff(day, person.birthdate, visit.date_started) / 365 AS age_at_visit,\n    person.dead AS dead,\n    person.death_date AS death_date,\n    person.cause_of_death AS cause_of_death,\n    person.voided AS person_voided,\n    person.uuid AS person_uuid\nFROM\n    visit\n    LEFT JOIN visit_type visit_type ON visit.visit_type_id = visit_type.visit_type_id\n    LEFT JOIN person person ON visit.patient_id = person.person_id\nWHERE\n    date_started &gt;= :startDate\n    AND (date_stopped IS NULL OR date_stopped &lt;= :endDate)\n</sqlQuery>\n        </parameterizable>\n        <parameterMappings id=\"12\">\n          <entry>\n            <string>endDate</string>\n            <string>${endDate}</string>\n          </entry>\n          <entry>\n            <string>startDate</string>\n            <string>${startDate}</string>\n          </entry>\n        </parameterMappings>\n      </org.openmrs.module.reporting.evaluation.parameter.Mapped>\n    </entry>\n  </dataSetDefinitions>\n</org.openmrs.module.reporting.report.definition.ReportDefinition>','2024-10-23 14:06:38',2,NULL,NULL,0,NULL,NULL,NULL,'ee0d4e55-9a0e-4d7c-ba85-e534102141ee'),
